window.bookSummaryJSON = "<p>As a knight of the Shadow Fae, I’m tasked with defending the institute. I’m deep into a world of dark magic, orgiastic death cults, and demon roller discos. </p> <p>But my new life begins with an impossible choice: turn over Ruadan within 24 hours, or my nemesis will unleash the Black Death. </p> <p>Worse, my old gladiator master is threatening to reveal my identity. If the truth gets out, I’ll be out of the institute faster than you can say \"wrath of an incubus\".</p> <p>If I can't find and kill my oldest enemy in time, then it's the Black Death for everyone, and I’ll be back on the run once more.</p>"; 
